import React from "react";
import NvBar from "./NvBar";
import {
  Card,
  CardBody,
  CardFooter,
  CardHeader,
  Heading,
  Image,
  Stack,
  Text,
} from "@chakra-ui/react";

const About = () => {
  return (
    <div>
      <NvBar />
      <Card
        direction={{ base: "column", sm: "row" }}
        overflow="hidden"
        variant="outline"
        marginTop={"45px"}
        borderRadius={"30px"}
        marginLeft={"10px"}
        marginRight={"10px"}
        shadow={"md"}
      >
        <Image
          objectFit="cover"
          maxW={{ base: "100%", sm: "200px" }}
          src={require("/Users/rohansingh/Desktop/WebDev/LiveStock_Project/frontend/src/Images/Misson_img.jpg")}
          alt="Caffe Latte"
        />

        <Stack>
          <CardBody>
            <Heading size="md">The perfect latte</Heading>

            <Text py="2">
            At the Farmers Disease Diagnostic/Reporting Portal, our mission is to empower farmers with the tools and knowledge they need to safeguard the health of their crops and livestock. By leveraging the power of Artificial Intelligence (AI), we aim to revolutionize agricultural health management, making it more accessible, efficient, and effective for farmers everywhere.

            </Text>
          </CardBody>

        </Stack>
      </Card>
    </div>
  );
};

export default About;
